        <!-- What is CLG -->
        <div class="container text-center p-sm-5 py-3 px-4" id="what-is-clg">
            <h1>What is CLG ?</h1>
            <p>
                An initiative by ITSNP ORG to help women tech enthusiast connect and learn new skills daily for 100 days
                for at least an
                hour a day while connecting and creating projects together with future women leaders. The main reason of
                CLG is to make
